import React from "react";
import { Link } from "react-router-dom";
import { FaUserCircle } from "react-icons/fa";

const Navbar = ({ authUser }) => {
  return (
    <header className="fixed top-0 left-0 w-full px-[100px] py-5 flex justify-between items-center z-[99] bg-transparent">
      {/* โลโก้ */}
      <Link to="/home" className="text-2xl font-bold text-white no-underline">
        Gemini
      </Link>

      {/* เมนู */}
      <nav className="flex items-center space-x-10">
        <Link to="/home" className="text-lg text-white no-underline font-medium">
          Home
        </Link>
        <Link to="/observation" className="text-lg text-white no-underline font-medium">
          Observation
        </Link>
        <Link to="/astrodata" className="text-lg text-white no-underline font-medium">
          Astronomical
        </Link>
        <Link to="/sciplan" className="text-lg text-white no-underline font-medium">
          Science plan
        </Link>

        {/* ปุ่ม Login/Profile */}
        {authUser ? (
          <Link to="/profile" className="text-white">
            <FaUserCircle size={28} />
          </Link>
        ) : (
          <Link
            to="/login"
            className="px-6 py-3 text-lg font-bold text-white border-2 border-white rounded-lg transition-all duration-300 
            hover:bg-white hover:text-[#162938] hover:-translate-y-[3px] no-underline"
          >
            Login
          </Link>
        )}
      </nav>
    </header>
  );
};

export default Navbar;
